  return (
    <div className="App">
      <NavBar />
      <div>
        <div className="p-5 bg-image" style={{ backgroundImage: `url(/fietslabyrint-background-1.png)`, height: '400px', backgroundRepeat: 'no-repeat', backgroundSize: "cover" }} />
